webpackJsonp([488],{"./node_modules/json-loader/index.js!./.cache/json/articles-meta-free-code-camp-cost.json":function(e,o){e.exports={data:{markdownRemark:{html:"<p>We will always be completely free for both students and for nonprofits.</p>\n<p>Our name is Free Code Camp. We are a free code camp. If you had to pay us (or sign over future earnings), we'd have to change our name. And we are not going to do that.</p>\n<p>Everyone working on our community and our open source projects is a volunteer.</p>\n<p>We plan to eventually cover our operational costs by earning job placement bonuses from companies who hire our graduates. Note that we will not actually garnish any wages from our graduates - employers are already paying recruiters thousands of dollars to find successful candidates. Employers will simply pay the recruitment bonus to Free Code Camp instead of paying a recruiter.</p>",frontmatter:{title:"Free Code Camp Cost",parent:"/home/stuart/guides/src/pages/articles/meta/free-code-camp-cost/index.md absPath of file"}}},pathContext:{slug:"/articles/meta/free-code-camp-cost/"}}}});
